webpackJsonp([0xf666994b17f],{1195:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Psyked.co.uk",author:"James Ford"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/flash-player-set-to-include-hd-video/index.md absPath of file >>> MarkdownRemark",html:'<p><img src="http://uploads.psyked.co.uk/2007/08/flashvideo.png" alt="Flash HD Video"></p>\n<p>Adobe has recently released the Beta of its\' next major update to the Flash Player - on <a href="http://labs.adobe.com/wiki/index.php/Flash_Player:9:Update:H.264" title="Open link in a new window">Abobe Labs</a> - and this time with HD Video support. (Amongst other general improvements) From a few other reports I\'ve come across, the final version is expected in a couple of months, and of course other Flash-based products like Adobe Air will also benefit from the same technology.</p>\n<p>It\'ll be interesting to see how fast the takeup is with sites like youtube or dailymotion. And compression? FLV (Flash Video) compression is awesome. (Stroke of genius by Macromedia - hiring Sorenson to do it) But I think full-on HD Video might be pushing the limits of it.</p>',frontmatter:{title:"Flash Player - set to include HD Video",date:"August 23, 2007",tags:["flash","adobe","beta","hd_video"],url:null}}},pathContext:{}}}});
